const NotoSerifRegular = `@font-face { font-family: 'Noto Serif'; font-style: normal; font-weight: 400; src: local('Noto Serif'), local('NotoSerif'), url('data:font/woff2;base64,') format('woff2'); }`;
const NotoSerifItalic = `@font-face { font-family: 'Noto Serif'; font-style: italic; font-weight: 400; src: local('Noto Serif Italic'), local('NotoSerif-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const NotoSerif700 = `@font-face { font-family: 'Noto Serif'; font-style: normal; font-weight: 700; src: local('Noto Serif Bold'), local('NotoSerif-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const NotoSerif700italic = `@font-face { font-family: 'Noto Serif'; font-style: italic; font-weight: 700; src: local('Noto Serif Bold Italic'), local('NotoSerif-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
